import React, { useState } from "react";
import "antd/dist/antd.css";
import { Drawer, Button } from "antd";

export default function App() {
  const [visible, setVisible] = useState(false);

  return (
    <div
      style={{
        display: "block",
        width: 700,
        padding: 30,
      }}
    >
      <h4>Testing Component</h4>
      <>
        <Button
          type="primary"
          onClick={() => {
            setVisible(true);
          }}
        >
          Open
        </Button>
        <Drawer
          title="Drawer Demo"
          drawerStyle={{
            color: "white",
          }}
          headerStyle={{
            backgroundColor: "#16151B",
            borderBottomWidth: 0,
          }}
          bodyStyle={{
            backgroundColor: "#16151B",
            color: "white",
          }}
          width={"70%"}
          placement="right"
          closable={true}
          keyboard={true}
          visible={visible}
          onClose={() => {
            setVisible(false);
          }}
        >
          <p>Item One</p>
          <p>Item Two</p>
          <p>Item Three</p>
          <p>Item Four</p>
          <p>Item Five</p>
        </Drawer>
      </>
    </div>
  );
}
